import React from "react";

import "./SideDrawer.css";

const sideDrawer = props => {
  return (
    <nav className="side-drawer">
      <ul>
        <li>
          <a href="/">Login</a>
        </li>
        <li>
          <a href="/">Register</a>
        </li>
        <li>
          <a href="/">Current Bids</a>
        </li>
      </ul>
    </nav>
  );
};

export default sideDrawer;
